import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Link, Switch, Route } from 'react-router-dom';
import './App.css';


function ManageCourse(){
    return (
        <div>
            <Link to="/manage_course/view_courses">
                <li className="bg-info link">View Course</li>
            </Link>
            <Router>
                <Switch>
                <Route path="/manage_course/view_courses">
                <ViewCourse />
                </Route>
                </Switch>
            </Router> 
        </div>
    );
}

